    in a jurisdiction and the cost per record to the party of building and maintaining
    the state wide voter file. Item 2. I have amended the report concerning party
    expenditures on behalf of Benjamin Cardin for 637000.00 to reflect that we were
    designated by the DSCC to make the expenditure. Item 3. Please note that the funds
