    5 I have amended report to provide the purpose for the disbursement that was not
    correctly reported. Item 6. Please note that items disclosed for dial in phone
    systems were generic in nature and not candidate specific. I amended the report
    and corrected the disclosure for one of the exempt mail to door hangers and Identified
    Federal Candidate, amended exempt mail piece to door hangers and Identified Federal
    candidate, and identified Federal Candidates for exempt mail disbursement. I have
    also amended disbursement for postage for mail piece to disclose Federal Candidate.
